package com.icfcc.SRRPService.util;


import java.security.Key;

import javax.crypto.Cipher;
import javax.crypto.spec.SecretKeySpec;

import org.apache.cxf.common.util.Base64Utility;

public class AESUtil  {
	
	private static final String AESTYPE = "AES/ECB/PKCS5Padding";
	
	public static String encrypt(String content, String key){
		if(content.length() < 1){
			return "";
		}
		byte[] encrypt = null;
		try{
			Key rekey = generateKey(key);
			Cipher cipher = Cipher.getInstance(AESTYPE);
			cipher.init(Cipher.ENCRYPT_MODE, rekey);
			encrypt = cipher.doFinal(content.getBytes("GBK"));
		}catch(Exception e){
			e.printStackTrace();
		}
		return new String(Base64Utility.encode(encrypt));
	}
	
	public static String decrypt(String content, String key){
		if(content.length() < 1){
			return "";
		}
		String temp="";
		byte[] decrypt = null;
		try{
			Key rekey = generateKey(key);
			Cipher cipher = Cipher.getInstance(AESTYPE);
			cipher.init(Cipher.DECRYPT_MODE, rekey);
			decrypt = cipher.doFinal(Base64Utility.decode(content));
			temp= new String(decrypt,"GBK");
		} catch (Exception e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		return temp;
	}
	
	private static Key generateKey(String key) throws Exception{
		try{
			SecretKeySpec keySpec = new SecretKeySpec(key.getBytes("GBK"),"AES");
			return keySpec;
		}catch(Exception e){
			e.printStackTrace();
		}
		return null;
	}
	

    public static void main(String[] args) {
    	AESUtil s = new AESUtil();
    	System.err.println(s.encrypt("sysadmin,", "123456qwerty1111"));
    	System.err.println(s.encrypt("888888", "123456qwerty1111"));
//    	System.err.println(s.encrypt(",", "123456qwerty1111"));
//    	System.err.println(s.encrypt("172.18.2.75", "123456qwerty1111"));
//    	System.err.println(s.decrypt("","123456qwerty1111"));
}
	
}